// src/App.js
import React from 'react';
import styled from 'styled-components';
import Calendar from './Calendar';
import Sidebar from './Sidebar';

const AppWrapper = styled.div`
  display: flex;
  justify-content: center;
  margin: 200px 20px;
  height: 100vh;
  padding: 20px;
  box-sizing: border-box;
`;

const ContentWrapper = styled.div`
  display: flex;
  flex-direction: row;
  align-items: flex-start;
  justify-content: center;
  width: 100%;
  max-width: 50%;

  @media (max-width: 1024px) {
    flex-direction: column;
    align-items: center;
  }
`;

const CalendarContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 70%;
`;

const SidebarContainer = styled.div`
  display: flex;
  align-items: flex-start;
  width: 30%;
`;

const App = () => {
  return (
    <AppWrapper>
      <ContentWrapper>
        <SidebarContainer>
          <Sidebar />
        </SidebarContainer>
        <CalendarContainer>
          <Calendar />
        </CalendarContainer>
      </ContentWrapper>
    </AppWrapper>
  );
};

export default App;
